import React from 'react'
import styled from 'styled-components'
const Body = styled.body`
    text-align:center;
`
const H1 = styled.h1`
    /* */
`
var Show = styled.div`
    
`
const Catalog = styled.div`
    display:inline;
    text-align:center;
    margin: 10px;
    border:5px solid black;
`
export default class Content extends React.Component{
    constructor(props){
        super(props);

    }
    handleChange = (n) => {
        n = "s"
    }
    render(){

        return(
            <Body>
                <Catalog><img src="/static/images/pic1.jpg" alt="king" width="100" height="50"/></Catalog>
                <Catalog><img src="/static/images/queenandking.jpg" alt="king" width="100" height="50"/></Catalog>
                <Catalog><img src="/static/images/kingandboat.jpg" alt="king" width="100" height="50"/></Catalog>
