                <Catalog><img src="/static/images/kingandpipe.jpg" alt="king" width="100" height="50"/></Catalog>
                <Catalog><img src="/static/images/kingandfufu.jpg" alt="king" width="100" height="50"/></Catalog>
                <Catalog><img src="/static/images/kingandoldkinggun.jpg" alt="king" width="100" height="50"/></Catalog>
                <Catalog><img src="/static/images/kingandgun.jpg" alt="king" width="100" height="50"/></Catalog>
                <Catalog><img src="/static/images/kingandfathergun.jpg" alt="king" width="100" height="50"/></Catalog>
                <Catalog><img src="/static/images/kingplantrice.jpg" alt="king" width="100" height="50"/></Catalog>
            </Body>
        )
    }
}
